import './styles/admin.css';

function Admin() {
    return (
        <div className="admin">
            
            
                    <h1> Store Administration</h1>

                    <div className='parent'>
                        <section className='sec-prods'>
                            <h3>Products</h3>
                        </section>

                        <section className='sec-coupons'>
                            <h3>Coupons</h3>
                            </section>
                    </div>
                </div>
                
                   
    );
}

export default Admin;
